import React, {Component} from 'react'
import toggleBtnDecorator from '../decorators/toggleBtnDecorator'
import addArticleSign from '../create-article.svg'

function ToggleCreate({ toggleAnimation, padding, transformL, transformR, opacity } ){

	const styles = {transition: 'all .3s ease-out'}

	return(
		<button className="icon-style " 
				onClick={ toggleAnimation }
				style={{padding: padding, ...styles}}
		 >
		  <div style={{transform:transformL, ...styles}} className="devL"></div> 

		  <div style={{transform:transformR, ...styles}} className="devR"></div>

		  <div style={{opacity:opacity, ...styles}}>
			<img src={addArticleSign} className='icon-style'  alt="search-sign" />
		  </div>

		</button> 

	)

}
export default toggleBtnDecorator(ToggleCreate)
